import { User } from './../entities/User';
import { InvitedUserInput, UserTypes } from './../../../../types/resolvers-types';
import { Context } from '../resolvers';
import { joinFrom } from './joinFrom';
import logger from '../../../../shared/log/logger';

/**
 * Gets a list of users from an array of emails
 * Creates anonymous accounts if they do not exist
 */
export default async (usersInvited: InvitedUserInput[], from: string, context: Context) => {
  const invitedUsers: User[] = [];
  const inviteUsersPromises = usersInvited.map(async u => {
    let user;
    try {
      if (u.id) {
        user = await User.buildFromId(u.id, joinFrom(from, 'getUsersListFromEmail'), context);
      } else if (u.email) {
        user = await User.buildFromEmail(u.email, joinFrom(from, 'getUsersListFromEmail'), context);
      }
    } catch (e) {
      // user doesnt exist, thats okay.
      logger.debug(`Could not find user ${u.id || u.email}. Making a new anonymous user.`);
    }


    if(user) {
      invitedUsers.push(user);
    } else {
      //create an anonymous user
      const anonymous = await User.create(
        {
          ...u,
          type: UserTypes.Anonymous,
        },
        joinFrom(from, 'getUsersListFromEmail'),
        context
      );
      invitedUsers.push(anonymous);
    }
  })
  await Promise.all(inviteUsersPromises);
  return invitedUsers;
}
